import styled from "styled-components";
import {Icon} from "../../icon/Icon";

type ElipsWrapperSkillType = {
    top: string
    left: string
    right: string
    bottom: string
    iconId: string
}


export const ElipsWrapperSkill = styled.div<ElipsWrapperSkillType>`

  top: ${props => props.top};
  left: ${props => props.left};
  right: ${props => props.right};
  bottom: ${props => props.bottom};
  iconId: ${props => props.iconId};

  position: absolute;
  height: 6rem;
  width: 6rem;
  margin: 1em auto;
  background-color: linear-gradient(#414141 0%, #2D2D2D 100%);
  background-image: url("${props => Icon({iconId: 'main_html'})}");
  border-radius: 50%;
  z-index: 1;



`
